import React from "react";
import { SwContext } from "../swContex";

function Table() {
    return(
        <SwContext.Consumer>
            { ({
                data,
            }) => (
              <table>
                <tr>
                    <th>Name</th>
                    <th>Rotation Period</th>
                    <th>Orbital Pedriod</th>
                    <th>Diameter</th>
                    <th>Climate</th>
                    <th>Gravity</th>
                    <th>Terrain</th>
                    <th>Surfece Water</th>
                    <th>Population</th>
                    <th>Films</th>
                    <th>Cread</th>
                    <th>Edited</th>
                    <th>URL</th>
                </tr>
            </table>  
            ) }
        </SwContext.Consumer>

    )
}

export default Table;
